INSERT INTO `wp_posts` VALUES (788,1,'2020-06-05 16:05:50','2020-06-05 16:05:50','<!-- wp:heading {\"level\":6} -->\n<h6><span style=\"color: #000000;\">Drag the right images to see the beautiful elasticity card effect.</span></h6>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Hansen Engineering Company established in 1962, is a leading manufacturer of precision NC machined multi-axis parts and major complex structural assemblies for commercial and military aircraft. HEC specializes in complex MDI surface geometry, statistical process control, and electronic probing of part surfaces. We manufacture parts from titanium, Inconel, heat-treated steel, aluminum, and most other alloys. Hansen is an approved ATA supplier for Spirit Aerosystems on the 737 next-generation aircraft program. We have also have become a supplier of a major structural assembly for the Boeing 767-2C tanker program.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:button {\"borderRadius\":0,\"align\":\"none\"} -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link no-border-radius\" href=\"#\">Read More</a></div>\n<!-- /wp:button -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','About us','','inherit','closed','closed','','41-revision-v1','','','2020-06-05 16:05:50','2020-06-05 16:05:50','',41,'http://hansen-engineering-co-v4.local/41-revision-v1/',0,'revision','',0);
